import React from 'react';
import styles from '../../styles/Passenger.module.css'
import car from '../../images/passenger/car.png'

function Passenger() {
    const {} = styles;

    return (
        <main>
            <div>
                <p>Passageiro</p>
            </div>
            <img src= {car} alt="carro lev" />
        </main>
    )
}

export default Passenger;
